function ProfilePhoto() {

    const ProfileImage = require('./Profile_Photo.jpg');
    return (
        <View>
            <Image source={ProfileImage} alt='ProfilePhoto' width='100%' style={{ borderColor: 'black', borderWidth: 5 }} />
        </View>
    )
}

export default ProfilePhoto;
